const Profile = ({ user }) => {
  return (
    <div>
      <h2>Perfil de Usuario</h2>
      <p><strong>Nombre:</strong> </p>
      <p><strong>Email:</strong> </p>
      {/* Otros campos de perfil como fecha de registro, direcci√≥n, etc. */}
    </div>
  );
};

export default Profile;
